import React, { useState, useEffect, useRef } from "react";
import "tailwindcss/tailwind.css";
import github from "./icons/github.png";
import behance from "./icons/behance.png";
import gmail from "./icons/gmail.png";
import linkedin from "./icons/linkedin.png";
import medium from "./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState([]);
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );

  const terminalRef = useRef(null);

  useEffect(() => {
    terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
  }, [output]);

  function handleCommand(e) {
    e.preventDefault();
    let newOutput = [...output, { command: command, output: "" }];
    switch (command.toLowerCase()) {
      case "about":
        newOutput[newOutput.length - 1].output = `My name is Fatima STAILI, I am a cybersecurity student who has had a long-standing passion for technology and security and a slight web development background, I am currently working on networking certifications. I am a bachelor student in cyber security and a member 
        of the development department of the GDG club, based in Orleans.`;
        break;
      case "work":
        newOutput[newOutput.length - 1].output = (
          <>
            <table className="table-fixed">
              <thead>
                <tr>
                  <th className="w-1/4">Date</th>
                  <th className="w-1/4">Company</th>
                  <th className="w-1/4">Role</th>
                  <th className="w-1/4">Description</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td></td>
                  <td></td>
                  <td>Digital Mediator</td>
                  <td></td>
                </tr>
                <tr>
                  <td></td>
                  <td></td>
                  <td>Assistant Chief Information Security Officer (CISO)</td>
                  <td></td>
                </tr>
                <tr>
                  <td></td>
                  <td></td>
                  <td>Assistant System and Network Administrator</td>
                  <td></td>
                </tr>
                <tr>
                  <td></td>
                  <td></td>
                  <td>Network Technician</td>
                  <td></td>
                </tr>
              </tbody>
            </table>
          </>
        );
        break;
      //... the rest of your cases
    }
    setOutput(newOutput);
    setCommand("");
  }

  function handleChange(e) {
    setCommand(e.target.value);
  }

  function handleKeyDown(e) {
    if (e.key === "Tab") {
      e.preventDefault();
      const commands = ["about", "contact", "socials", "education", "work", "projects", "hobbies", "clear", "get cv"];
      const match = commands.find((cmd) => cmd.startsWith(command));
      if (match) {
        setCommand(match);
      }
    }
  }
  return (
    <div className="bg-black h-screen w-screen flex justify-center items-center">
      <div className="bg-gray-900 text-white text-left flex flex-col rounded-lg w-2/3 h-3/4 overflow-hidden">
        {/* ... */}
        <div className="flex-grow bg-gray-800 p-4 overflow-auto" ref={terminalRef}>
          <div className="mb-6 text-center" dangerouslySetInnerHTML={{ __html: welcomeMessage }}></div>
          {output.map((item, index) => (
            <div key={index}>
              <div className="mt-2 text-blue-500 font-mono">visitor@terminal.staili : ~$ {item.command}</div>
              <div className="mt-2">
                <pre className="text-green-500">{item.output}</pre>
              </div>
            </div>
          ))}
          <form onSubmit={handleCommand} className="flex">
            <div className="mr-2 text-blue-500 font-mono self-end">visitor@terminal.staili : ~$</div>
            <input
              type="text"
              value={command}
              onChange={handleChange}
              onKeyDown={handleKeyDown}
              className="flex-grow bg-transparent text-green-300 focus:outline-none border-b-2 border-green-300 font-mono"
            />
          </form>
        </div>
      </div>
    </div>
  );
}

export default Terminal;
